export async function ConnectServer() {
    fetch("ConnectFrontend").then(response => response.json()).then(response => {
        return (
            <div className="allUsers">
                {
                    response.map(element => {
                        <p>{element.firstname}</p>
                    })
                }
            </div>
        )
    })
}
